window.bookSummaryJSON = "<p><b>There’s no such thing as peace on Amir…</b></p> <p>…but as long as the uneasy truce between the Osay colonists and the last of the RUPAC station directors endures, one thing is certain: Brody is bored to death.</p> <p>While the eccentric, action-movie-worshipping battle android does his best to stay occupied, Reach and the colonists contemplate whether to help a mysterious faction <i>inside </i>the RUPAC stronghold. The enemy colonists desire liberty, but is Amir willing to go to war to bring it to them?</p> <p>Obviously.</p> <p>Join Brody, Reach, the Rangers, Liana, Doctor Roman, and the rest of the action-packed cast you’ve grown to love one last time in… <i>Wayward Galaxy 6</i>!</p> <p>Welcome to the p-party, p-pal!</p>"; 
